query getBillingMetrics(
  $accountTag: string!
  $filter: AccountWorkersInvocationsAdaptiveFilter_InputObject
  $overviewFilter: AccountWorkersInvocationsAdaptiveFilter_InputObject
) {
  viewer {
    accounts(filter: { accountTag: $accountTag }) {
      durableObjectsStorageGroups(limit: 10000, filter: $filter) {
        max {
          storedBytes
        }
      }
      pagesFunctionsInvocationsAdaptiveGroups(limit: 1000, filter: $filter) {
        sum {
          duration
          requests
        }
        dimensions {
          usageModel
        }
      }
      workersInvocationsAdaptive(limit: 10000, filter: $filter) {
        sum {
          duration
          requests
          subrequests
          responseBodySize
          errors
        }
        quantiles {
          cpuTimeP50
        }
        dimensions {
          usageModel
        }
      }
      workersOverviewRequestsAdaptiveGroups(
        limit: 1000
        filter: $overviewFilter
      ) {
        sum {
          cpuTimeUs
        }
        dimensions {
          usageModel
        }
      }
      durableObjectsInvocationsAdaptiveGroups(
        limit: 10000
        filter: $durableObjectFilter
      ) {
        sum {
          requests
        }
      }
      durableObjectsPeriodicGroups(
        limit: 10000
        filter: $durableObjectFilter
      ) {
        sum {
          activeTime
        }
      }
    }
  }
}

query getWorkersAndPagesOverviewBetaMetrics(
  $accountTag: string!
  $monthlyFilter: AccountWorkersInvocationsAdaptiveFilter_InputObject
  $monthlyOverviewFilter: AccountWorkersInvocationsAdaptiveFilter_InputObject
  $dailyFilter: AccountWorkersInvocationsAdaptiveFilter_InputObject
  $dailyOverviewFilter: AccountWorkersInvocationsAdaptiveFilter_InputObject
) {
  viewer {
    accounts(filter: { accountTag: $accountTag }) {
      monthlyPagesFunctionsInvocationsAdaptiveGroups: pagesFunctionsInvocationsAdaptiveGroups(
